import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { Grid, Paper, Typography, Icon, Avatar, Divider } from '@material-ui/core';

import Background from './imgs/1x/background.png';

const useStyles = makeStyles(theme => ({
    container: {
        backgroundImage: `url(${Background})`,
        backgroundSize: 'cover',
        height: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'flex-start',
    },
    paper: {
        width: '50%',
        marginTop: 80,
        padding: 30,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexWrap: 'wrap',
        backgroundColor: 'rgb(255, 255, 255, 0.1)',
        color: 'white'
    },
    terri: {
        width: '100%',
    },
    contact: {
        position: 'relative',
        width: '50%',
        marginTop: 20,
        padding: 20,
        backgroundColor: 'rgb(255, 255, 255, 0.1)',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        color: 'white'
    },
    icons: {
        position: 'absolute',
        top: '50%',
        left: 20,
        transform: 'translate(0, -50%)',
        background: 'linear-gradient(45deg, #38ef7d 30%, #11998e 90%)',
    },
}));

const Info =  () => {

    const classes = useStyles();

    return (
        <Grid className={classes.container} item xs={12}>

            <Paper className={classes.paper}>

                <Typography className={classes.terri} variant="h1" align="center">
                    Terri Banner
                </Typography>

                <Divider style={{width: '80%'}} />

                <Paper className={classes.contact} >

                    <Avatar className={classes.icons}>

                        <Icon>local_phone</Icon>

                    </Avatar>

                    <Typography variant="h5" align="center">
                        704.577.5028
                    </Typography>

                </Paper>
                <Paper className={classes.contact}>

                    <Avatar className={classes.icons}>

                        <Icon>email</Icon>

                    </Avatar>

                    <Typography variant="h5" align="center">
                        robogator@aol.com
                    </Typography>

                </Paper>

            </Paper>

        </Grid>

    );
};

export default Info;
